import React, { useState } from 'react'; // Import useState
import { View, Text, TouchableOpacity, StyleSheet, Image } from 'react-native';
import { useNavigate } from 'react-router-dom'; // Ensure to import useNavigate
import arrow from "./AlwaysActive/images/arrow.png";
import { personList } from '../Application/Classes/testDataGenerator';


const persons = personList;
const Home = () => { // Rename to start with uppercase
    const [hoveredIndex, setHoveredIndex] = useState(null);
    const navigate = useNavigate();

    const handleNavigation = (route) => {
        navigate(route); // Navigate to the corresponding route
    };

    return (
        <View style={stylesContainers.container}>
            <View style={stylesContainers.welcomeView}>
                <Text style={stylesTexts.welcomeText}>Willkommen!</Text>
            </View>
            <View style={stylesContainers.diffcont}>
                <View style={stylesContainers.viewListExponate}>
                    <View>
                        <View style={{ flexDirection: "row", margin: 20 }}>
                            <Text style={stylesTexts.titleOfLists}>Exponate</Text>
                            <View style={{ paddingLeft: 850 }}>
                                <TouchableOpacity onPress={() => handleNavigation("/exponate")}> 
                                    <Image style={stylesTexts.images} source={arrow} />
                                </TouchableOpacity>
                            </View>
                        </View>
                    </View>
                </View>
                <View style={stylesContainers.viewListPersonen}>
                    <View>
                        <View style={{ flexDirection: "row", marginLeft:20,marginRight:20,marginTop: 20 }}>
                            <Text style={stylesTexts.titleOfLists}>Personen</Text>
                            <View style={{ paddingLeft: 150 }}>
                                <TouchableOpacity onPress={() => handleNavigation("/persons")}> 
                                    <Image style={stylesTexts.images} source={arrow} />
                                </TouchableOpacity>
                            </View>
                        </View>
                    </View>
                    <View style={{marginLeft:20,marginRight:20,marginTop: 3}}>
                        <Text style={stylesTexts.listValueName}>Name </Text>
                        <View style={{backgroundColor: "red"}}>
                        <View style={stylesContainers.simpleList}>
                            {persons.map((person,index) => (
                                <View style={{width:400,flexDirection:"row"}} key={index}>
                                    <View style={stylesTexts.simpleListItem}>
                                        <View style={{flexDirection:"row",width:400}}>
                                            <Text style={{fontWeight:"bold"}}>{person.nachname}</Text>
                                            <Text> </Text>
                                            <Text>{person.vorname}</Text>
                                        </View>
                                    </View>
                                </View>
                            ))}
                        </View>
                        </View>
                    </View>
                </View>
            </View>
            <View style={stylesContainers.viewListAuktionen}>
                <View>
                    <View style={{ flexDirection: "row", margin: 20 }}>
                        <Text style={stylesTexts.titleOfLists}>Auktionen</Text>
                        <View style={{ paddingLeft: 1175 }}>
                            <TouchableOpacity onPress={() => handleNavigation("/auction")}> 
                                <Image style={stylesTexts.images} source={arrow} />
                            </TouchableOpacity>
                        </View>
                    </View>
                </View>
            </View>
        </View>
    );
};

const stylesContainers = StyleSheet.create({
    container: {
        flexDirection: "column",
        justifyContent: 'center',
        alignItems: 'center',
        width: 1350,
        paddingLeft: 20
    },
    diffcont: {
        flexDirection: "row",
        padding: 20
    },
    viewListExponate: {
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        paddingLeft: 10,
        paddingRight: 10,
        height: 300,
        width: 1000,
        margin: 10
    },
    viewListPersonen: {
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        paddingLeft: 10,
        paddingRight: 10,
        height: 300,
        width: 300,
        margin: 10
    },
    viewListAuktionen: {
        borderWidth: 1,
        borderColor: 'lightgray',
        borderRadius: 5,
        height: 300,
        width: 1325,
    },
    welcomeView: {
        paddingTop: 40,
        paddingBottom: 20,
    },
    simpleList: {
        padding: 10,
        //backgroundColor: '#f9f9f9',
        borderRadius: 5,
        width: '100%',


    },
});

const stylesTexts = StyleSheet.create({
    welcomeText: {
        color: 'rgba(240,175,77,1)',
        fontWeight: "bold",
        fontSize: 50,
    },
    titleOfLists: {
        color: 'rgba(141,69,85,1)',
        fontWeight: "bold",
        fontSize: 17
    },
    listValueName: {
        fontWeight: "bold",
        fontSize: 14
    },
    images: {
        width: 20,
        height: 20,
    },
    simpleListItem: {
        flexDirection: "row",
        fontSize: 16,
        paddingVertical: 5,
        borderBottomWidth: 1,
        borderBottomColor: '#ddd',

    },
});

export default Home; // Ensure to export with uppercase
